demo.repl.help:
Tillgängliga kommandon:
  @show              ─ visa den senaste sammanfattningen av adaptivt kort
  @json              ─ skriv ut det råa JSON-värdet som togs emot från flödet
  @back              ─ återgå till föregående blockerade kort/inmatningar
  @input <k>=<v>     ─ sätt eller åsidosätt ett inmatningsfält
  @click <action_id> ─ skicka kortet med den angivna åtgärden
  @help              ─ skriv ut denna hjälptext
  @quit              ─ avsluta REPL
